import './Button.css';
import { Icons } from './Icons';

const Button = ({
  className,
  icon,
  text,
  onClick
}) => { 
  const {svgPath} = Icons[icon];
  return (
    <button className={`button ${className}`} onClick={onClick}>
      {svgPath}
      <div class="button__text">{text}</div>
    </button>
  );
}

export default Button;
